import { Box, Grid, Typography } from "@mui/material";
import React from "react";

export default function Page2() {
    return (
        <>
            <Grid container>
            <Grid container item xs={3} sx={{ height: '500px', backgroundColor: 'gray', position: 'relative', overflowY: 'auto' }}>
      <Typography variant="h5" sx={{ mt: '2%', textAlign: 'center' }}>Assets</Typography>
      <Box
        sx={{
          flexGrow: 1,
          overflowY: 'auto',
          paddingBottom: '50px',
        }}
      >
        {[1, 2, 3, 4, 5].map((item) => (
          <Box key={item} sx={{ mt: '2%', display: 'flex', justifyContent: 'space-evenly', alignItems: 'center' }}>
            <Grid item xs={5}>
              <Box sx={{ height: '80px', backgroundColor: 'red' }} />
              <Typography variant="p">vid-103.mpg</Typography>
            </Grid>
            <Grid item xs={5}>
              <Box sx={{ height: '80px', backgroundColor: 'yellow' }} />
              <Typography variant="p">vid-103.mp3</Typography>
            </Grid>
          </Box>
        ))}
      </Box>
      <Grid container sx={{ backgroundColor: 'yellow', height: '50px', position: 'absolute', bottom: '0', width: '100%' }}>
        <Typography variant="body1" align="center">Bottom Content</Typography>
      </Grid>
    </Grid>

                <Grid item xs={6} sx={{ height: '200px', backgroundColor: 'blue' }}>

                </Grid>
                <Grid item xs={3} sx={{ height: '200px', backgroundColor: 'green', }}>

                </Grid>
            </Grid>
        </>
    );
}
